import React from "react";

interface Props {
  uuid: string;
  name: string;
  description: string;
  count: number;
}

const Community: React.FC<Props> = ({ uuid, name, description, count }) => {
  return (
    <React.Fragment>
      <div className="community-container">
        <p>{name}</p>
        <p>Number of Posts: {count}</p>
        <p>{description}</p>
      </div>

      <style jsx>{`
        .community-container {
          width: 95%;
          border: 1px solid red;
          margin: 0 auto;
        }
      `}</style>
    </React.Fragment>
  );
};

export default Community;
